import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container";
import { Button } from "react-bootstrap";
import "../styles/mainPage.css";

export default function MainPage() {
  return (
    <div>
        <header className="text-start p-3" style={{backgroundColor: 'rgb(120, 120, 140)'}}>
          <i className="fa-solid fa-address-book text-dark"></i>
          <span className="ms-5">Contacts App</span>
        </header>
      <Container className="text-center mt-5">
        <h1 className="mt-5">Contacts App!</h1>
        <h1 className="mt-5">You can save your contacts in this site</h1>
        <Button href="/signin" className="sign-in-button bg-dark border-0 mt-5">
          Sign in!
        </Button>
      </Container>
    </div>
  );
}
